function MyComponent(){

  const [name, setName] = useState();
  const updateName = () =>{
    name="spongebob";
    console.log(name);
  }
  return(<div>
    <p>Name: {name}</p>
    <button onClick={updateName}></button>
  </div>)
}

export default MyComponent
